import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import ProductDetail from './components/ProductDetail';
import './styles/Landingpage.css';

function App() {
  return (
    <div className="App">
      <Header />
      <ProductDetail />
      <Footer />
    </div>
  );
}

export default App;
